import Home from '@/pages/Home'
import Search from '@/pages/Search'
import Login from '@/pages/Login'
import Register from '@/pages/Register'
import Detail from '@/pages/Detail'
import AddCartSuccess from '@/pages/AddCartSuccess'
import ShopCart from '@/pages/ShopCart'
import Trade from '@/pages/Trade'
export default
    [
        {
            path: '/trade',
            component: Trade
        },
        {
            path: '/shopcart',
            component: ShopCart
        },
        {
            path: '/addcartsuccess',
            name: 'addcartsuccess',
            component: AddCartSuccess
        },
        {
            path: '/home',
            component: Home
        },
        {
            path: '/search/:keyword?',
            component: Search,
            name: "search"
        },
        {
            path: '/login',
            component: Login
        },
        {
            path: '/register',
            component: Register
        },
        {
            name: "detail",
            path: '/detail/:id',
            component: Detail,
        },
        {
            //重定向
            path: '*',
            redirect: '/home'
        }
    ]
